import axios from 'axios';

const PRODUCTS_URL = 'https://fakestoreapi.com/products';

class ProductProvider {

  static async getAllProduct() {
    console.log("Getting Started")
    return axios({
      mode: 'no-cors',
      method: 'GET',
      url: PRODUCTS_URL,
    })
      .then(
        res => {
          res.data
          console.log('here');
        }
        )
      .catch(err => err);
  }
}

export default ProductProvider;
